import React from 'react';
import { Link } from 'react-router-dom';

const StationDetail = ({ match }) => {
  return(
    <div>
      <h3>{match.params.stationName}</h3>
      <ul>
        <li>
          <Link to="/Stations">Volver a estaciones</Link>
        </li>
      </ul>
    </div>
  );
};

export default StationDetail;
